import './App.css';

import Navbar from './components/Navbar';
import HomePage from './pages/HomePage';


function App() {
  return (
    <Router>
      <AuthProvider>
        <div className="App">
      <Navbar />
      <HomePage />
    </div>
      </AuthProvider>
    </Router>

  );
}

export default App;
